import logo from './logo.svg';
import './App.css';
import { useEffect } from 'react';

function App() {

  // useEffect(() => {
  //   console.log("hello")
  //   fetch('https://dev-ptqk6ibc8njgm5ty.us.auth0.com/authorize?response_type=code&client_id=xmPoVoVk6WrffxGwPhDyOVUB3uhuDqre&state=12345&redirect_uri=http://localhost:3000/redirect&code_challenge=T9WZXhjQei8x7qi83JNXPn3QOjgppKCrz1St3486oGg&code_challenge_method=S256').then(res => res.json()).then(data => console.log(data))
  // }, [])

  useEffect(() => {
    const authUrl = 'https://dev-ptqk6ibc8njgm5ty.us.auth0.com/authorize?response_type=code&client_id=xmPoVoVk6WrffxGwPhDyOVUB3uhuDqre&state=12345&redirect_uri=http://localhost:3000/redirect&code_challenge=T9WZXhjQei8x7qi83JNXPn3QOjgppKCrz1St3486oGg&code_challenge_method=S256';
    if(window.location.href.includes('code')) {
      return
    }
    window.location.href = authUrl;
  }, []);


  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
